import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import 'react-mdl/extra/material.css';
import 'react-mdl/extra/material.js';

var music_title = [];
music_title[0] = 'Still In Love';
music_title[1] = 'You and Me';
function textSeq(i) {
    if(music_title.length > i) {
        setTimeout(function() {
          document.getElementById("title-text").innerHTML = this.props.music_title[i];
          textSeq(i++);
        },1000)
      }
      else if(music_title.length == i) {
        textSeq(0);
      }
}
ReactDOM.render(<App music_title={music_title} />, document.getElementById('root'));


// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
